import { Container,makeStyles,Typography,Avatar,ImageList,ImageListItem } from '@material-ui/core';
import { AvatarGroup } from '@material-ui/lab/';



const useStyles = makeStyles((theme) => ({
  container: {
    paddingTop: theme.spacing(10),
  },
  title:{
    fontSize:16,
    fontWeight: 500,
    color: "#555",
  },
}));
export default function RightBar() {
  const classes = useStyles();

  return (
    <Container className={classes.container}>
      <Typography className={classes.title} gutterBottom> Online friends</Typography>

      <AvatarGroup max={4} style={{marginBottom:20}}>
        <Avatar alt="Remy Sharp" src="https://material-ui.com/static/images/avatar/1.jpg" />
        <Avatar alt="Travis Howard" src="https://material-ui.com/static/images/avatar/2.jpg" />
        <Avatar alt="Cindy Baker" src="https://material-ui.com/static/images/avatar/3.jpg" />
        <Avatar alt="Agnes Walker" src="https://material-ui.com/static/images/avatar/4.jpg" />
        <Avatar alt="Trevor Henderson" src="https://material-ui.com/static/images/avatar/5.jpg" />
      </AvatarGroup>
      <Typography className={classes.title} gutterBottom> Gallery</Typography>
      <ImageList rowHeight={100} style={{marginBottom:20}} cols={2}>
        <ImageListItem >
          <img src="https://material-ui.com/static/images/image-list/breakfast.jpg" alt="" />
        </ImageListItem>
        <ImageListItem >
          <img src="https://material-ui.com/static/images/image-list/burgers.jpg" alt="" />
        </ImageListItem>
        <ImageListItem >
          <img src="https://material-ui.com/static/images/image-list/camera.jpg" alt="" />
        </ImageListItem>
        <ImageListItem >
          <img src="https://material-ui.com/static/images/image-list/morning.jpg" alt="" />
        </ImageListItem>
        <ImageListItem >
          <img src="https://material-ui.com/static/images/image-list/hats.jpg" alt="" />
        </ImageListItem>
        <ImageListItem >
          <img src="https://material-ui.com/static/images/image-list/honey.jpg" alt="" />
        </ImageListItem>
      </ImageList>
      <Typography className={classes.title} gutterBottom> Categories</Typography>
    </Container>
  );
}
